    false,nt"url": null,nt"notes": "This Environmental Assessment for the acquisition
    of approximately 9,300 acres known as Marais des Cygnes National Wildlife Refuge
    for the purpose of protecting bottomland hardwood habitats along the Marais des
    Cygnes River in Linn County, Kansas. The Fish and Wildlife Service has responded
    to selected comments provided on the draft Assessment and incorporated necessary
    changes into the text. We have selected Alternative B, the Direct Management Alternative,
    as the alternative that best serves the interests of wildlife and people in the
    area. This document completes the administrative requirements under the National
    Environmental Policy Act of 1969, and also includes the Finding of No Significant
    Impact (FONSI).",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
